import React from "react";
import Form from "../form/Form";
import Button from "../button/Button";
import { withRouter } from "react-router-dom";

const Tokens = (props) => {
  const massiv = [];
  massiv.length = 4;
  const changed_fnc = (event) => {
    massiv[event.target.id] = event.target.value;
    console.log(massiv);
  };
  const clk = () => {
    props.history.push({
      pathname: "/api/showdata",
      ugugdul: "tokens",
    });
  };
  return (
    <div className="pagez">
      <h1>Токеноор</h1>
      <div className="form_holder">
        <Form changed={changed_fnc} placeholder="amount" id="1" />
        {/* <Form placeholder="checksum" id="2" /> */}
        <Form changed={changed_fnc} placeholder="transactionId" id="2" />
        {/* <Form placeholder="lang" id="4" /> */}
        <Form
          changed={changed_fnc}
          placeholder="token"
          id="3"
          utga="2d38f609c868c1b5f94b2320a9a9244897e0cf8176a01ec802e99ed418c3f97b"
        />
      </div>
      <Button onclk={clk} whichcomp="tokens"></Button>
    </div>
  );
};

export default withRouter(Tokens);
